{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jaredjennings89/analytics-case-studay-bellabeat-analysis?scriptVersionId=136617071\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"02854d8e","metadata":{"papermill":{"duration":0.018964,"end_time":"2023-07-13T05:05:25.163284","exception":false,"start_time":"2023-07-13T05:05:25.14432","status":"completed"},"tags":[]},"source":["* [Case Study 2](#chapter1)\n","    * [The Characters](#section_1_1)\n","    * [The Products](#section_1_2)\n","* [Part 1](#chapter2)\n","* [Part 2](#chapter3)\n","* [Part 3](#chapter4)\n","* [Part 4](#chapter5)\n","* [Part 5](#chapter6)\n","* [Part 6](#chapter7)\n","* [License](#License)"]},{"cell_type":"markdown","id":"6b8a7924","metadata":{"_cell_guid":"1b3faa2f-d96c-47a3-a12e-d8639628aec4","_uuid":"87b7afca-4a78-4dc2-9568-3aec77fff533","papermill":{"duration":0.014887,"end_time":"2023-07-13T05:05:25.19316","exception":false,"start_time":"2023-07-13T05:05:25.178273","status":"completed"},"tags":[]},"source":["****Case Study 2: How Can a Wellness Technology \n","Company Play It Smart?****  <a class=\"anchor\"  id=\"chapter1\"></a>\n"]},{"cell_type":"markdown","id":"a56da98d","metadata":{"papermill":{"duration":0.014807,"end_time":"2023-07-13T05:05:25.223071","exception":false,"start_time":"2023-07-13T05:05:25.208264","status":"completed"},"tags":[]},"source":["Introduction:\n","\n","Good day! I will be using the Bellabeat Case Study for my capstone in the Professional Data Analytics Certificate given by Google (found on Coursera). I will be playing the role of a junior data analyst who has recently been brought onto the Bellabeat marketing team with the main goal of analyzing wearable fitness device data  that I might come up with some suggestions for the business as a whole. \n","\n","I will be using the outlined **\"Ask, Prepare, Process, Analyze, Share, and Act** given through the Analytics Certificate Program. This will be the first case study I undertake and one of the first items that will go into my portfolio. \n","\n","SO! Let us begin."]},{"cell_type":"markdown","id":"9c684867","metadata":{"papermill":{"duration":0.014806,"end_time":"2023-07-13T05:05:25.252778","exception":false,"start_time":"2023-07-13T05:05:25.237972","status":"completed"},"tags":[]},"source":["**The Characters** <a class=\"anchor\"  id=\"subsection1\"></a>"]},{"cell_type":"markdown","id":"dba68bca","metadata":{"_cell_guid":"003075dc-8c88-41d4-873b-958cf3c08963","_execution_state":"idle","_uuid":"eeada7c6-61ea-45ff-862b-8846f26bc710","papermill":{"duration":0.014832,"end_time":"2023-07-13T05:05:25.282383","exception":false,"start_time":"2023-07-13T05:05:25.267551","status":"completed"},"tags":[]},"source":["\n","* *Urska Srsen*: Bellabeat's cofounder and Chief Creative Officer\n","* *Sando Murr*: Mathemetician and another of Bellabeat's cofounders, a key member of the Bellabeat executive team. \n","* *Bellabeat Marketing Analytics Team*: In this scenario, it is effectively myself as the junior data analyst who has recently been hired by Bellabeats."]},{"cell_type":"markdown","id":"c77f0295","metadata":{"papermill":{"duration":0.014835,"end_time":"2023-07-13T05:05:25.312154","exception":false,"start_time":"2023-07-13T05:05:25.297319","status":"completed"},"tags":[]},"source":["**Products** <a class=\"anchor\"  id=\"subsection2\"></a>"]},{"cell_type":"markdown","id":"eabf4ff7","metadata":{"_cell_guid":"d3013dd4-d54d-49cd-91ad-c97cdbb749df","_uuid":"96a77bce-3cc5-48e1-b4ef-6b907df45fec","papermill":{"duration":0.014744,"end_time":"2023-07-13T05:05:25.341559","exception":false,"start_time":"2023-07-13T05:05:25.326815","status":"completed"},"tags":[]},"source":["\n","* *Bellabeat App*: The app is the effective hub for all Bellabeat wearable products and records all data we will use in this analysis. \n","* *Leaf*: Bellabeat's classic wellness tracker. It can be used as a clip, a necklace, or a bracelet.\n","* *Time*: Bellabeat's proprietery watch\n","* *Spring*: The Bellabeat water bottle. This connects to the app to keep track of all water intake throughout the day. \n","* *Bellabeat Membership*: Much like other fitness tracking companies Bellabeat offers a premium service through the app which gives personalized guidance on nutrition, acitivty, sleep, health, beauty, and mindulness goals based on their profile."]},{"cell_type":"markdown","id":"240666db","metadata":{"_cell_guid":"d4ed45fb-0fc9-4d4a-a8de-69fbdcf1707b","_uuid":"0c90fbcd-f96a-46cf-81ad-1eb3ff105328","papermill":{"duration":0.014651,"end_time":"2023-07-13T05:05:25.370819","exception":false,"start_time":"2023-07-13T05:05:25.356168","status":"completed"},"tags":[]},"source":["**Step One: Ask** <a class=\"anchor\"  id=\"chapter2\"></a>"]},{"cell_type":"markdown","id":"8405b78d","metadata":{"_cell_guid":"a98b4134-9e83-4a05-a308-b21a7378cc08","_uuid":"1e6b64fe-788b-44ca-8d6c-d59ae7a46386","papermill":{"duration":0.015263,"end_time":"2023-07-13T05:05:25.40066","exception":false,"start_time":"2023-07-13T05:05:25.385397","status":"completed"},"tags":[]},"source":["What is the overall goal in the project? The direct ask from Gda. Srsen is ato analyze other device usesage data in order to gain a much greater understanding of the potential for the wearable health device market. \n","\n","To put in other words:\n","* What are the most common uses of other wearable health based products on the market? \n","* How could those trends apply to Bellabeat consumers? \n","* And how could these trends help the overall marketing strategy?"]},{"cell_type":"markdown","id":"30d5464c","metadata":{"_cell_guid":"aa7314e5-b288-4a44-bae8-5d36a943aeb3","_uuid":"e9481041-d2a3-4dec-a7fa-cab62da75446","papermill":{"duration":0.014527,"end_time":"2023-07-13T05:05:25.43016","exception":false,"start_time":"2023-07-13T05:05:25.415633","status":"completed"},"tags":[]},"source":["When the key players are considered the overall task becomes quite straighforward: Analyze the data obatined by other wearable health devices to provide the appropriate insight and begin to offer potential strategies."]},{"cell_type":"markdown","id":"cbf1e356","metadata":{"_cell_guid":"55a902db-1162-4320-807a-41274e98348b","_uuid":"0f88d055-c60d-4885-897c-47b28f836d1a","papermill":{"duration":0.014696,"end_time":"2023-07-13T05:05:25.460169","exception":false,"start_time":"2023-07-13T05:05:25.445473","status":"completed"},"tags":[]},"source":["**Step Two: Prepare** <a class=\"anchor\"  id=\"chapter3\"></a>"]},{"cell_type":"markdown","id":"e5008af4","metadata":{"_cell_guid":"67b19222-2088-442d-9c52-573d9d9cd4b8","_uuid":"08b10545-6241-44f0-b2c3-9c0ac43b9c82","papermill":{"duration":0.014577,"end_time":"2023-07-13T05:05:25.489558","exception":false,"start_time":"2023-07-13T05:05:25.474981","status":"completed"},"tags":[]},"source":["Gda.Srsen has pointed us in the direction of a public data set given through the FitBit program. \n","\n","**Fitbit Fitness Tracker Data** is the name of this data set. It is a CC0: Public Domain data set made available through *Mobius*. It is hosted through *Kaggle*. \n","It contains a host of information provided by some thirty willing participants such as: heart rate tracking, sleep tracking, caloric intake, daily activity, and steps. \n","\n","Some overall acknowledgements/restrictions on the data: \n","* The data itself is, at this point, fairly unreliable insofar as making **major** changes to a business model. It's dated from April 12th, 2016 to May 12th 2016. It is fairly out of date at this point and only covers a month worth of information. While this can be useful in beginning to point people in the right direction, it should not have a large amount of weight given to it when making changes to a business model. \n","* This is a public use data set hosted through Kaggle, so there is no issues with regard to licensing, privacy, security, or accessibility. All individuals who allowed their data to be tracked are labeled through random numbers. No other information is given beyond this, all else is data based upon their usage of the FitBit device. \n","* The data's integrity and credibility has been assured by both *Mobius* as well as *Kaggle*. The data can be found [here](https://www.kaggle.com/datasets/arashnic/fitbit)"]},{"cell_type":"markdown","id":"c9f248f5","metadata":{"_cell_guid":"fe90f8c3-8b9c-4a31-87f7-2763f8eedfc9","_uuid":"60d47be6-1292-4a86-9f87-6d38ad0e1b3c","papermill":{"duration":0.014777,"end_time":"2023-07-13T05:05:25.519206","exception":false,"start_time":"2023-07-13T05:05:25.504429","status":"completed"},"tags":[]},"source":["**Step Three: Process** <a class=\"anchor\"  id=\"chapter4\"></a>"]},{"cell_type":"markdown","id":"3685fb39","metadata":{"_cell_guid":"48b6bf95-f5d5-4fa7-9b1d-2e26b248f1fa","_uuid":"3aebf571-9d37-4f69-bd5a-af147f1a5869","papermill":{"duration":0.014789,"end_time":"2023-07-13T05:05:25.549815","exception":false,"start_time":"2023-07-13T05:05:25.535026","status":"completed"},"tags":[]},"source":["I will be using R for this analysis. With the multitude of packages for statisitcal analysis and visualization in R it seems the perfect fit. \n","\n","I have downloaded the data and attached it to this notebook to access it for the sake of this analysis/report. \n","\n","This will be a step-by-step process taken through 3 phases. **Importing/Cleaning, Transformation, and Analysis**"]},{"cell_type":"markdown","id":"886c46f8","metadata":{"_cell_guid":"ab49eca6-9296-4803-9f35-77654e4887a1","_uuid":"aedbad0f-d6f0-4154-926a-3771e2ee0137","papermill":{"duration":0.014776,"end_time":"2023-07-13T05:05:25.579668","exception":false,"start_time":"2023-07-13T05:05:25.564892","status":"completed"},"tags":[]},"source":["**Phase One: Import/Cleaning**\n","We have imported the data into our notebook. We will now begin by downloading the preffered packages to clean, transform, and analyze this data. \n","\n","There are a plethora of other packages, but those shown below are my personal preference for the analysis of the data based upon my experience in the R portion of the Data Analytics Professional Certification. \n","\n","As our first step, we will download the following packages:"]},{"cell_type":"code","execution_count":1,"id":"caf0a5f9","metadata":{"_cell_guid":"12032a0e-3f47-4a8d-861d-5d47645cc247","_uuid":"a2c3272a-e9cf-44dd-8527-e5f0e4a9c453","execution":{"iopub.execute_input":"2023-07-13T05:05:25.614026Z","iopub.status.busy":"2023-07-13T05:05:25.611484Z","iopub.status.idle":"2023-07-13T05:06:05.151726Z","shell.execute_reply":"2023-07-13T05:06:05.149586Z"},"papermill":{"duration":39.560429,"end_time":"2023-07-13T05:06:05.154808","exception":false,"start_time":"2023-07-13T05:05:25.594379","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"tidyverse\")\n","install.packages(\"skimr\")\n","install.packages(\"janitor\")"]},{"cell_type":"markdown","id":"e50ae4f8","metadata":{"_cell_guid":"feeee94c-2324-4c4c-8764-e66d94031582","_uuid":"246b37db-3768-4d4e-8981-adfb3a9ce4b6","papermill":{"duration":0.015172,"end_time":"2023-07-13T05:06:05.186519","exception":false,"start_time":"2023-07-13T05:06:05.171347","status":"completed"},"tags":[]},"source":["Now, we will install the libaries for the above packages. This will give us the ability to use each package and element therein to its fullest degree."]},{"cell_type":"code","execution_count":2,"id":"930f21e9","metadata":{"_cell_guid":"8621145c-14b0-4c61-bcb6-7961965b1f4e","_uuid":"49c3bc9e-f20e-4934-b89f-9d2b