\"Minutes of Sleep\",\n","         fill=\"Sleep Time Adequacy\")"]},{"cell_type":"markdown","id":"559f2f36","metadata":{"_cell_guid":"6f320786-248a-45ff-823f-18adc0d6d4c5","_uuid":"a59d9ddc-1b6f-4969-a8ba-6e67f3fcf0ce","execution":{"iopub.execute_input":"2023-07-06T07:57:16.008533Z","iopub.status.busy":"2023-07-06T07:57:16.006079Z","iopub.status.idle":"2023-07-06T07:57:16.081625Z"},"papermill":{"duration":0.046015,"end_time":"2023-07-13T05:06:23.649808","exception":false,"start_time":"2023-07-13T05:06:23.603793","status":"completed"},"tags":[]},"source":["Just looking at this directly we can see that, while in the beinning there seemed to be a great deal more inadequate sleep than adequate, we can see a slight shift over time toward people being able to sleep for longer. "]},{"cell_type":"markdown","id":"dce5e406","metadata":{"_cell_guid":"c4ad5e8f-a454-4e1c-8c4e-c767663a595a","_uuid":"d03e3b93-e2f3-43f6-8ea9-0913ffc9cfd4","papermill":{"duration":0.046637,"end_time":"2023-07-13T05:06:23.743349","exception":false,"start_time":"2023-07-13T05:06:23.696712","status":"completed"},"tags":[]},"source":["Part 5:**Share** <a class=\"anchor\"  id=\"chapter6\"></a>"]},{"cell_type":"markdown","id":"f1282f6c","metadata":{"papermill":{"duration":0.047921,"end_time":"2023-07-13T05:06:23.837074","exception":false,"start_time":"2023-07-13T05:06:23.789153","status":"completed"},"tags":[]},"source":["So, let's go back and look at our original questions: \n","* What are the most common uses of other wearable health based products on the market? \n","* How could those trends apply to Bellabeat consumers? \n","* And how could these trends help the overall marketing strategy?\n","\n","Have we answered them well? I say as best we can given both the amount of data we have and how long it has been since the data was last updated. \n","\n","* The first thing we found was that, by and large, the wearables were used to track sleep and activity. Weight was not something high ona fair number of people's priority list, but more on that later. \n","* Second, these trends apply because they can easily be projected onto the Bellabeat consumer base. While Bellabeat may serve a much smaller demographic than FitBit, alot of the same conclusions can apply. \n","* And third, these trends will begin to help shift the direction of Bellabeat's marketing strategy as well as assist in future product launches, making it so Bellabeat can better serve all of their customers.\n"]},{"cell_type":"markdown","id":"bf2bd49f","metadata":{"papermill":{"duration":0.047369,"end_time":"2023-07-13T05:06:23.93137","exception":false,"start_time":"2023-07-13T05:06:23.884001","status":"completed"},"tags":[]},"source":["**Reccomendations:**\n","\n","* 1. Look into the user interface for the Bellabeat App with regard to caloric intake and weight tracking it seems far easier for consumers to consistently log their caloric intake vs. their weight. This may be a result of the fact that weight can fluctuate at about 5lbs/2.5kg per day based on a host of factors, leading most to take into account that daily weigh ins don't offer much in the way of insight. However, weekly weigh ins, ESPECIALLY with such discipline in keeping track of caloric intake, can lead to a very positive outcome for the person. I would reccomend and reminder of sorts on the Bellabeat app to help people become more consistent about weigh ins. Further, there could also be an incentive created for consumers that would make them feel good about hitting certain milestones that they themselves set up. \n","* 2. Speaking further about the caloric intake data frame, there's something that could also be added: a Macro-nutrient counter. A large number of apps now take into accout the macronutrients of what you're eating (Protein, Carbs, and Fats). They have varying nutrition and fitness goals which go beyond just calorie counting. In effect, just because someone went under their calorie goal for the day, does not in of itself mean they succeeded. They could have taken in far too many Carbs and/or far too little protein to meet their daily goals. There is a definite potential there. \n","* 3. One thing of note about the daily activity is how there was a sudden drop off toward the end of the month. The Washington Post article I mentioned earlier states that, over time, these wearable health devices find themselves in junk drawers and night stands after some time. Either because the benefit is not being seen, or the discomfort outweighs any benefit that has been seen as of yet. In this case, I would highly recommend that Bellabeat begin looking into alternative accessories for these devices. Watch bands that don't cause skin irritation, for example. If the customer can be made to feel more comfortable when wearing a device there is a good chance they will keep wearing it for longer periods of time. \n","* 4. Another idea would be to add an incentive program for useage over time. Small gift cards, bonuses, extra perks on the program, etc. All of these could be ways to keep people wanting to wear the devices to they can continue to monitor their health and welness over time. \n","* 5. Finally, much like the previous mention of adding to the calorie counter, adding a sort of overall grading system for one's sleep. Having enough time to sleep is good, yes, however just because one is sleeping long enough does not mean that said sleep is of good quality. Many factors can cause issues with the restfulness of one's sleep. Sleep apnea, snoring, noise, and stress all play a factor. Having addtional programming on both the app and wearable device would allow someone to gain a better understanding of things keeping them from having a good night's rest. Things like snoring detection, blood oxygen levels, even pulse could be tracked throughout the night; with an equation going at the very end to give the overall sleep a certain grade. "]},{"cell_type":"markdown","id":"6250807d","metadata":{"papermill":{"duration":0.046192,"end_time":"2023-07-13T05:06:24.023943","exception":false,"start_time":"2023-07-13T05:06:23.977751","status":"completed"},"tags":[]},"source":["Part 6: **Act** <a class=\"anchor\"  id=\"chapter7\"></a>"]},{"cell_type":"markdown","id":"bdc001cd","metadata":{"papermill":{"duration":0.046072,"end_time":"2023-07-13T05:06:24.116154","exception":false,"start_time":"2023-07-13T05:06:24.070082","status":"completed"},"tags":[]},"source":["The onus now falls upon the Bellabeat Corporate Officers to begin putting together a game plan with these reccomendations. I will provide any help that I can, of course. Hopefully, we will be able to create a more in-depth analysis with more comprehensive data in the future. "]},{"cell_type":"markdown","id":"a4ffe8a5","metadata":{"papermill":{"duration":0.046041,"end_time":"2023-07-13T05:06:24.208271","exception":false,"start_time":"2023-07-13T05:06:24.16223","status":"completed"},"tags":[]},"source":["This concludes the Bellabeat Google Analytics Capstone Study. This was an excellent first look into the world of analytics and the possiblities therein. Thank you all for your time. "]},{"cell_type":"markdown","id":"c6ed748c","metadata":{"_cell_guid":"c4ad5e8f-a454-4e1c-8c4e-c767663a595a","_uuid":"d03e3b93-e2f3-43f6-8ea9-0913ffc9cfd4","papermill":{"duration":0.045922,"end_time":"2023-07-13T05:06:24.300114","exception":false,"start_time":"2023-07-13T05:06:24.254192","status":"completed"},"tags":[]},"source":["**License** <a class=\"anchor\"  id=\"License\"></a>"]},{"cell_type":"markdown","id":"c5549c85","metadata":{"papermill":{"duration":0.048387,"end_time":"2023-07-13T05:06:24.397281","exception":false,"start_time":"2023-07-13T05:06:24.348894","status":"completed"},"tags":[]},"source":["Copyright 2023 Christopher \"Jared\" Jennings\n","\n","Licensed under the Apache License, Version 2.0 (the \"License\");\n","you may not use this file except in compliance with the License.\n","You may obtain a copy of the License at\n","\n","   